package leetcode

import org.junit.jupiter.api.Assertions.assertEquals
import org.junit.jupiter.api.Test

class SmallestSubsequence5893 {
    fun smallestSubsequence(s: String, kk: Int, letter: Char, repetition: Int): String {
        var k = kk
        val n = s.length
        var r = 1
        val pos = MutableList(repetition + 1) { n - 1 }
        for (i in n - 1 downTo 0)
            if (s[i] == letter) {
                pos[r] = i
                if (r >= repetition)
                    break
                r += 1
            }

        return buildString {
            val que = ArrayDeque<Int>()
            var i = 0
            while (i < n && k > r) {
                val t = n - k
                while (i <= minOf(pos[r], t)) {
                    while (que.isNotEmpty() && s[i] < s[que.lastOrNull()!!])
                        que.removeLast()
                    que.add(i)
                    i += 1
                }
                val j = que.removeFirst()
                append(s[j])
                if (s[j] == letter)
                    r = maxOf(0, r - 1)
                k -= 1
            }
            repeat(r) { append(letter) }
        }
        // todo: fix it - why O(n) TLE ???
    }


    @Test
    fun test1() {
        assertEquals("eet", smallestSubsequence("leet", 3, 'e', 1))
        assertEquals(
            "",
            smallestSubsequence(
                "",
                13712, 'p', 275
            )
        )
    }
}
